import Head from "next/head";
import styles from "../../styles/Home.module.css";
import TextField from "@material-ui/core/TextField";
import { useState, useCallback, useEffect } from "react";

export default function Home() {
  const [urlvideo, setUrlvideo] = useState("____");
  const [urlvideoTime,setUrlvideoTime] = useState("Compartilhe no tempo certo do youtube");
  const [minuto, setMinuto] = useState(0);
  const [segundo, setSegundo] = useState(0);
  const [handleChngTimer,sethandleChngTimer] = useState(0);

  const pegaCtrlCC = useCallback(
    ()=> {
    let arma = navigator.clipboard.readText().then((cip) => {
      setUrlvideo(cip);
      console.log(urlvideo);
    });

  }
  );
  const criaUrl = ()=>{
    let tempoReal = minuto*60+segundo;
    console.log("tr "+tempoReal);
  }

  useEffect( 
    ()=>{
   pegaCtrlCC
   criaUrl
    },[minuto,segundo]);

  return (
    <div className={styles.container}>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main className={styles.main}>
        <h1 className={styles.title}>
          {urlvideoTime}
        </h1>
        <TextField
          id="tes"
          name="min"
          label="Minutos"
          onMouseLeave={({target})=>setMinuto(target.value)}
          />

        <TextField
          id="standard-basic"
          label="Segundos"
          name="seg"
          onMouseLeave={({target})=>setSegundo(target.value)}
        />
        <TextField
          id="filled-basic"
          label="Filled"
          variant="filled"
          value={urlvideoTime}
          style={{ width: "100%" }}
        />

        <p className={styles.description}>
          Get started by editingg
          <code className={styles.code}>pages/index.js</code>
        </p>

        <div className={styles.grid}>
          <a href="https://nextjs.org/docs" className={styles.card}>
            <h3>Documentation &rarr;</h3>
            <p>Find in-depth information about Next.js features and API.</p>
          </a>

          <a href="https://nextjs.org/learn" className={styles.card}>
            <h3>Learn &rarr;</h3>
            <p>Learn about Next.js in an interactive course with quizzes!</p>
          </a>

          <a
            href="https://github.com/vercel/next.js/tree/master/examples"
            className={styles.card}
          >
            <h3>Examples &rarr;</h3>
            <p>Discover and deploy boilerplate example Next.js projects.</p>
          </a>

          <a
            href="https://vercel.com/import?filter=next.js&utm_source=create-next-app&utm_medium=default-template&utm_campaign=create-next-app"
            className={styles.card}
          >
            <h3>Deploy &rarr;</h3>
            <p>
              Instantly deploy your Next.js site to a public URL with Vercel.
            </p>
          </a>
        </div>
      </main>

      <footer className={styles.footer}>
        <a
          href="https://vercel.com?utm_source=create-next-app&utm_medium=default-template&utm_campaign=create-next-app"
          target="_blank"
          rel="noopener noreferrer"
        >
          Powered by{" "}
          <img src="/vercel.svg" alt="Vercel Logo" className={styles.logo} />
        </a>
      </footer>
    </div>
  );
}
